    false,nt"url": null,nt"notes": "This report summarizes the results of the
    second United States Army Kwajalein Atoll (USAKA) Activities in the Republic of
    the Marshall Islands (UES) inventory of endangered species and wildlife resources
    at USAKA, which was conducted in 1998. The first was taken in 1996. These reports
    are used as the official record of species and habitats of concern at USAKA. For
    the National Oceanographic Data Center, interest in the report focuses on the marine
    element. Data tables from marine surveys of sponges, corals, and mollusks species
    are given.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
